import logo from './logo.svg';
import './App.css';
import Registration from './components/Registration';
import Login from './components/Login';
import AxiosInstance from './Axios';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
} from "react-router-dom";


function Content(){
  const title = "";
  AxiosInstance
      .get("/api/users/1")
      .then(res =>{
        title = res;
      })
      .catch((error)=>{
        title = "Not log in yet";
      });
  return(
    <h1>{title}</h1>
  )
}

function App() {


  return(
    <Router>
      <div>
        <Link to = "/" >Home</Link>
        <Link to = "/about">About</Link>
        <Link to = "/registration">Registration</Link>
        <Link to = "/login">Log in</Link>
        <Link to = "/content">content</Link>

        <Switch>
          <Route path = "/" exact>
            <Home />
          </Route>
          <Route path = "/about">
            <About />
          </Route>
          <Route path = "/registration">
            <Registration />
          </Route>
          <Route path = "/login">
            <Login />
          </Route>
          <Route path = "/content">
            <Content />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;

function Home() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

function About(){
  return <h1>About</h1>;
}
